import React, { Component } from 'react';

class description extends Component {
    render() {
        return (
            <div className="carddescription">
                <div className="tbl">
                    <div className="tbl-cell">
                        {this.props.children}
                    </div>
                </div>
            </div>
        );
    }
}

export default description;
